import {
  Button,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Grid,
  Typography,
} from "@mui/material";
import React from "react";
import { useMediaQuery } from "@mui/material";
import { useTheme } from "@mui/material";
import { makeStyles } from "@mui/styles";
import PersonOutline from "@mui/icons-material/PersonOutline";
import { NewspaperOutlined } from "@mui/icons-material";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    height: "100vh",
  },
  button: {
    textTransform: "none",
    fontSize: 11,
  },
}));

const HomePage = () => {
  const classes = useStyles();
  const theme = useTheme();
  const small = useMediaQuery(theme.breakpoints.only("xs"));
  const medium = useMediaQuery(theme.breakpoints.only("sm"));

  return (
    <div>
      <Grid container spacing={1}>
        <Grid xs={12} sm={7} md={6}></Grid>

        <Grid xs={12} sm={5} md={6}>
          <Card sx={{ mb: 3, mt: 3 }}></Card>
        </Grid>
      </Grid>
    </div>
  );
};

export default HomePage;
